import React from 'react';
import { FaFacebookF } from "react-icons/fa";



function Card(){
    return(
        <>
<div className="card">
<div className="heading">
</div>
<img className="profile" src="./Image/Sank.jpg" alt=""/>
    <h1 class="name">SHASHANK TIWARI</h1>
<div class="icon">
<ul>
    <li>FaFacebookF</li>
</ul>
</div>
</div>




</>
    );
}
export default Card;
